  // Normaliza el texto para la búsqueda
  function normalizarTexto(texto) {
    return texto
      .toLowerCase()
      .normalize("NFD").replace(/[\u0300-\u036f]/g, "") // quita acentos
      .trim();
  }

  // Búsqueda en vivo
  document.getElementById("busqueda").addEventListener("input", function () {
    let filtro = normalizarTexto(this.value);

    if (filtro === "") {
      document.getElementById("lista").innerHTML = "";
      document.getElementById("resultado").innerHTML = "";
      return;
    }

    let resultados = datos.filter(p =>
      normalizarTexto(p.NOMBRE).includes(filtro) ||
      normalizarTexto(p.APELLIDOS).includes(filtro)
    );

    mostrarResultados(resultados);
  });

  // Limpiar búsqueda
  document.getElementById("limpiarBtn").addEventListener("click", function () {
    document.getElementById("busqueda").value = "";
    document.getElementById("lista").innerHTML = "";
    document.getElementById("resultado").innerHTML = "";
  });

  // Mostrar lista de coincidencias
  function mostrarResultados(resultados) {
    let lista = document.getElementById("lista");
    lista.innerHTML = "";

    if (resultados.length === 0) {
      lista.innerHTML = "<div>No hay coincidencias</div>";
      document.getElementById("resultado").innerHTML = "";
      return;
    }

    resultados.forEach(p => {
      let div = document.createElement("div");
      div.textContent = p.NOMBRE + " " + p.APELLIDOS;
      div.addEventListener("click", function () {
        mostrarDetalle(p);
      });
      lista.appendChild(div);
    });
  }

  // Mostrar detalle de un participante y borrar la lista
  function mostrarDetalle(p) {
    document.getElementById("lista").innerHTML = ""; 
    document.getElementById("busqueda").value = "";  

    let resultado = document.getElementById("resultado");

    // Campos a mostrar con etiquetas legibles
    let campos = {
      "NOMBRE": "Nombre",
      "APELLIDOS": "Apellidos",
      "DORSAL": "Dorsal",
      "GÉNERO": "Género",
      "DOCUMENTO DE IDENTIDAD": "Documento",
      "TARIFA": "Tarifa",
      "EMAIL": "Email",
      "TELÉFONO MÓVIL": "Teléfono",
      "CAMISETA OFICIAL": "Camiseta oficial",
      "CAMISETA OFICIAL EXTRA": "Camiseta oficial extra",
      "CAJON DE SALIDA": "Cajón de salida",
      "DONA TU MEDALLA FINISHER": "Donación medalla"
    };

    // Construcción dinámica de la tabla
    let tabla = "<table>";
    for (let clave in campos) {
      if (p[clave] && p[clave].toString().trim() !== "") {
        tabla += `<tr><th>${campos[clave]}</th><td>${p[clave]}</td></tr>`;
      }
    }
    tabla += "</table>";

    resultado.innerHTML = tabla;
  }
</script>
